module.exports={title:"SISU",alias:"sisu",calendar:[{text:"Perodo de inscries",textDate:"16 de Fev a 24 de Fev",startDate:"2023-02-16T00:00:00",endDate:"2023-02-24T23:59:00",uri:"https://sisualuno.mec.gov.br/#/login        ",buttonText:"Inscreva-se"},{text:"Resultado da chamada regular",textDate:"28 de Fev",startDate:"2023-02-28T00:00:00",endDate:"2023-03-08T23:59:00",uri:"https://sisu.mec.gov.br/#/selecionados",buttonText:"Consultar"},{text:"Matrcula da chamada regular",textDate:"02 a 08 de Mar",startDate:"2023-03-02T00:00:00",endDate:"2023-03-08T23:59:00"},{text:"Prazo para participar da lista de espera",textDate:"28 de Fev a 08 de Mar",startDate:"2023-02-28T00:00:00",endDate:"2023-03-08T23:59:50",uri:"https://sisualuno.mec.gov.br/",buttonText:"Consultar"},{text:"Convocao dos candidatos em lista de espera pelas instituies a partir desta data",textDate:"13 de Mar",startDate:"2023-03-13T08:00:00",endDate:"2023-04-28T23:59:50"}],avatar:{uri:"",text:"Inscreva-se e escolha at duas das opes de curso superior ofertadas por instituies pblicas."},videos:[{text:"Confira o Passo a Passo para Efetuar Inscrio no Sisu",uri:"https://www.youtube.com/embed/YR5u6V1zw78"}],download:{text:"Ver e baixar documentaes",uri:""},content:[{title:"O QUE ?",text:"O Sistema de Seleo Unificada (Sisu) rene em um sistema eletrnico gerido pelo MEC as vagas ofertadas por instituies pblicas de ensino superior de todo o Brasil, sendo a grande maioria delas ofertada por instituies federais (universidades e institutos). O sistema executa a seleo dos estudantes com base na nota do Exame Nacional do Ensino Mdio (Enem). At o limite da oferta das vagas, por curso e modalidade de concorrncia, de acordo com as escolhas dos candidatos inscritos, eles so selecionados por ordem de maior classificao, em cada uma das duas edies anuais do Sisu."}],topics:[{title:"Como funciona o Sisu?",text:"<p>A inscrio ao Sisu  gratuita e feita, exclusivamente, pela internet.</p><p>O acesso ao sistema de inscrio do Sisu  realizado com as informaes de login e senha para acesso aos servios digitais do governo federal, mediante uma conta no gov.br. Se voc ainda no possui cadastro na pgina gov.br <a href='https://sso.acesso.gov.br/login'>clique aqui</a> para criar sua conta e se inscrever no Sisu, usando login e senha do cadastro do gov.br.</p><p>No momento em que o candidato realiza o login no Sisu, o sistema recupera, automaticamente, as notas dele obtidas na edio do Enem vlida para o processo seletivo.</p><p>No ato da inscrio, o candidato escolhe <strong>at duas opes</strong> de curso dentre as ofertadas em cada processo seletivo do Sisu.  possvel alterar as opes de curso durante todo o perodo de inscries. A inscrio vlida ser a ltima registrada no sistema.</p><p>Quem no for selecionado em nenhuma das duas opes de curso indicadas no ato de inscrio ainda pode disputar uma das vagas por meio da lista de espera do Sisu. Fique atento tambm aos prazos para manifestar interesse em participar da lista de espera.</p><p>As vagas ofertadas no Sisu so distribudas conforme determinao da Lei de Cotas (Lei 12.711/2012) e, ainda, de acordo com as polticas e aes afirmativas que podem ser adotadas por instituies pblicas de ensino superior, como vagas reservadas e aplicao de bnus sobre a nota do candidato que atenda o perfil indicado pela instituio. De acordo com as especificaes da instituio, o sistema faz, automaticamente, o clculo e gera uma nova nota, que  apresentada ao candidato.</p><p>Mais detalhes no tutorial: <a href='https://sisu.mec.gov.br/#/como-funciona#onepage'>COMO FUNCIONA O SISU?</a></p>"},{title:"Quem pode se inscrever?",text:"Todos os estudantes que participaram do Exame Nacional do Ensino Mdio (Enem), edio mais recente antes do processo seletivo do Sisu, obtiveram nota na prova de redao maior do que zero e no declararam estar na condio de treineiro ao se inscrever no Enem."},{title:"Como se inscrever?",text:"<p>Com o seu acesso.gov.br feito, na pgina de inscrio do portal, a primeira coisa a fazer  confirmar os dados para o Sisu entrar em contato com voc. Depois da atualizao, voc est pronto para comear sua inscrio.</p><p>Voc pode escolher at duas opes de curso. Voc vai acompanhar sua inscrio durante todo o processo.</p><p>Mais detalhes no tutorial: <a href='https://sisu.mec.gov.br/#/como-se-inscrever'>COMO SE INSCREVER?</a></p>"}],buttons:[{text:"Ver legislao do programa",uri:"https://sisu.mec.gov.br/#/legislacao",isForever:!0},{text:"Consultar relatrios",uri:"https://sisu.mec.gov.br/#/relatorio#onepage",isForever:!0},{text:"Consultar ofertas de vagas",uri:"https://sisu.mec.gov.br/#/vagas",startDate:"2023-01-27T15:00:00",endDate:"2032-06-15T23:59:59"},{text:"Ver meu boletim",uri:"https://sisualuno.mec.gov.br/",startDate:"2023-02-25T00:00:00",endDate:"2032-07-02T23:59:59"},{text:"Resultado da chamada regular",startDate:"2023-02-28T00:00:00",endDate:"2032-01-01T23:59:59",uri:"https://sisu.mec.gov.br/#/selecionados"},{text:"Resultado da lista de espera",uri:"https://sisu.mec.gov.br/#/selecionados-lista-espera",startDate:"2023-03-13T09:00:00",endDate:"2032-07-25T00:00:00"},{text:"Ver inscrio",uri:"https://sisualuno.mec.gov.br/",startDate:"2023-02-16T00:00:00",endDate:"2023-02-24T23:59:59"}]};
