module.exports={title:"PROUNI",alias:"prouni",calendar:[{text:"Consulta de bolsas",textDate:"23 a 27 de Fev",startDate:"2023-02-23T18:30:00",endDate:"2023-02-27T23:59:59",uri:"https://prounialuno.mec.gov.br/consulta/publica",buttonText:"Consulta de bolsas"},{text:"Perodo de inscries",textDate:"28 de Fev a 03 de Mar",startDate:"2023-02-28T08:00:01",endDate:"2023-03-03T23:59:59",uri:"https://prounialuno.mec.gov.br",buttonText:"Inscreva-se"},{text:"Resultado da 1 chamada",textDate:"07 de Mar",startDate:"2023-03-07T08:00:01",endDate:"2023-03-17T23:59:59",uri:"https://prounialuno.mec.gov.br",buttonText:"Consultar"},{text:"Comprovao de informaes da 1 chamada",textDate:"07 a 16 de Mar",startDate:"2023-03-07T08:00:01",endDate:"2023-03-16T23:59:59",uri:"https://prounialuno.mec.gov.br",buttonText:"Ver inscrio"},{text:"Resultado da 2 chamada",textDate:"21 de Mar",startDate:"2023-03-21T08:00:01",endDate:"2023-03-31T23:59:59",uri:"https://prounialuno.mec.gov.br",buttonText:"Consultar"},{text:"Comprovao de informaes da 2 chamada",textDate:"21 a 30 de Mar",startDate:"2023-03-21T08:00:01",endDate:"2023-03-30T23:59:59",uri:"https://prounialuno.mec.gov.br",buttonText:"Ver inscrio"},{text:"Prazo para participar da Lista de Espera",textDate:"05 a 06 de Abr",startDate:"2023-04-05T08:00:01",endDate:"2023-04-06T23:59:59",uri:"https://prounialuno.mec.gov.br",buttonText:"Manifestar interesse"},{text:"Divulgao da Lista de Espera",textDate:"10 a 19 de Abr",startDate:"2023-04-10T08:00:01",endDate:"2023-04-19T23:59:59",uri:"https://prounialuno.mec.gov.br",buttonText:"Consultar"},{text:"Comprovao de informaes da Lista de Espera",textDate:"10 a 19 de Abr",startDate:"2023-04-10T08:00:01",endDate:"2023-04-19T23:59:59",uri:"https://prounialuno.mec.gov.br",buttonText:"Ver inscrio"}],avatar:{uri:"",text:"Inscreva-se no <strong>PROUNI</strong> e conquiste bolsas de estudo, integrais e parciais nas melhores instituies particulares de educao superior."},videos:[],download:{text:"Ver e baixar documentaes",uri:""},content:[{title:"O QUE ?",text:"O Programa Universidade Para Todos (Prouni) oferta bolsas de estudo, integrais e parciais (50% do valor da mensalidade do curso), em cursos de graduao e sequenciais de formao especfica, em instituies de educao superior privadas. O pblico-alvo do programa  o estudante sem diploma de nvel superior."}],topics:[{title:"Como se inscrever?",text:"Para se inscrever  preciso ter realizado pelo menos uma das duas ltimas edies do Enem, realizada antes do processo seletivo, e ter alcanado, no mnimo, 450 pontos de mdia nas notas das cinco provas do exame. Alm disso, o estudante no pode ter tirado zero na prova de redao do Enem e nem ter participado do exame na condio de treineiro."},{title:"Quem pode participar?",text:"<p>O candidato pr-selecionado deve comprovar renda familiar bruta mensal, por pessoa, de at 1,5 salrio mnimo, para obter a bolsa integral, que cobre a totalidade do valor da mensalidade do curso. J para a bolsa parcial, que cobre (50%) do valor da mensalidade, a renda mensal per capita exigida  de at 3 salrios mnimos.</p><p>Para participar do Prouni  preciso atender a pelo menos uma das seguintes condies:</p><ol class='ac-list ac-list--roman'><li>tenha cursado: <ol class='ac-list ac-list--latin'><li>o ensino mdio integralmente em escola da rede pblica;</li><li>o ensino mdio integralmente em instituio privada, na condio de bolsista integral da respectiva instituio;</li><li>o ensino mdio parcialmente em escola da rede pblica e parcialmente em instituio privada, na condio de bolsista integral da respectiva instituio;</li><li>o ensino mdio parcialmente em escola da rede pblica e parcialmente em instituio privada, na condio de bolsista parcial da respectiva instituio ou sem a condio de bolsista; e</li><li>o ensino mdio integralmente em instituio privada, na condio de bolsista parcial da respectiva instituio ou sem a condio de bolsista;</li></ol></li><li>seja pessoa com deficincia, na forma prevista na legislao; e</li><li>seja professor da rede pblica de ensino, exclusivamente para os cursos de licenciatura e pedagogia, destinados  formao do magistrio da educao bsica. Neste caso no  aplicado o limite de renda exigido aos demais candidatos</li></ol>"},{title:"Acesso SisProuni",text:"<p>Voc que  instituio de ensino, para ter de usar o sistema do SisProuni acesse o link abaixo:</p> <a href='http://prouni.mec.gov.br/prouni2006/login/' class='br-button primary' aria-label='Clique para acessar o SisProuni'>Clique aqui</a>"}],buttons:[{text:"Ver legislao do programa",uri:"https://prouniportal.mec.gov.br/legislacao",isForever:!0},{text:"Consulta de bolsas",uri:"https://prounialuno.mec.gov.br/consulta/publica",isForever:!1,startDate:"2023-02-23T18:30:00",endDate:"2023-02-27T23:59:59"},{text:"Ver Inscrio",uri:"https://prounialuno.mec.gov.br",isForever:!1,startDate:"2023-02-28T08:00:01",endDate:"2023-03-03T23:59:59"},{text:"Lista de selecionados 1 chamada",uri:"https://prounialuno.mec.gov.br/consulta/lista-espera",isForever:!1,startDate:"2023-03-07T08:00:01",endDate:"2023-03-17T23:59:59"},{text:"Lista de selecionados 2 chamada",uri:"https://prounialuno.mec.gov.br/consulta/lista-espera",isForever:!1,startDate:"2023-03-21T08:00:01",endDate:"2023-03-31T23:59:59"}],bottomAlert:""};
