module.exports={title:"FIES",alias:"fies",calendar:[{text:"Complementao da inscrio postergada",textDate:"07 a 09 de Fev",startDate:"2023-02-07T00:00:00",endDate:"2023-02-09T23:59:59",uri:"https://fiesselecaoaluno.mec.gov.br"},{text:"Perodo de inscries",textDate:"07 a 10 de Mar",startDate:"2023-03-07T00:00:00",endDate:"2023-03-10T23:59:59",uri:"https://fiesselecaoaluno.mec.gov.br",buttonText:"Inscreva-se"},{text:"Resultado",textDate:"14 de Mar",startDate:"2023-03-14T00:00:00",endDate:"2023-03-14T23:59:59",uri:"https://fiesselecaoaluno.mec.gov.br",buttonText:"Consultar"},{text:"Complementao das informaes da inscrio",textDate:"15 a 17 de Mar",startDate:"2023-03-15T00:00:00",endDate:"2023-03-17T23:59:59",uri:"https://fiesselecaoaluno.mec.gov.br",buttonText:"Complementar"},{text:"Convocao da lista de espera",textDate:"21 de Mar a 18 de Mai",startDate:"2023-03-21T00:00:00",endDate:"2023-05-18T23:59:59",uri:"https://fiesselecaoaluno.mec.gov.br",buttonText:"Consultar"}],avatar:{uri:"",text:"Inscreva-se no <strong>FIES</strong> e conquiste a vaga dos seus sonhos por meio do financiamento estudantil."},videos:[],download:{text:"Ver e baixar documentaes",uri:""},content:[{title:"O QUE ?",text:"O Fundo de Financiamento Estudantil (FIES)  um programa do Ministrio da Educao (MEC), institudo pela Lei n 10.260, de 12 de julho de 2001, que tem como objetivo conceder financiamento a estudantes em cursos superiores no gratuitos, com avaliao positiva Sistema Nacional de Avaliao da Educao Superior (Sinaes) e ofertados por instituies de educao superior no gratuitas aderentes ao programa. A partir de 2018, o FIES possibilita juros zero a quem mais precisa e uma escala de financiamento que varia conforme a renda familiar do candidato. O financiado comear a pagar as prestaes respeitando o seu limite de renda, fazendo com que os encargos a serem pagos diminuam consideravelmente."}],topics:[{title:"Como participar?",text:"<p>Se inscrevendo nos processos seletivos, em datas definidas nos editais da Secretaria de Educao Superior (SESu).</p><p>Poder se inscrever no FIES, o candidato que tenha participado do ENEM, a partir da edio de 2010 e tenha obtido mdia aritmtica das notas nas provas igual ou superior a 450 (quatrocentos e cinquenta) pontos e nota superior a 0 (zero) na redao. Tambm  necessrio possuir renda familiar mensal bruta, por pessoa, de at 3 (trs) salrios mnimos.</p><p>Competindo, exclusivamente, ao candidato certificarse de que cumpre aos requisitos estabelecidos para concorrer ao referido processo seletivo, observadas as vedaes previstas no edital do processo seletivo vigente.</p>"},{title:"Como se inscrever no Fies",text:"<p>Acessando o sistema de inscrio do FIES, em perodo determinado em edital e possuir cadastro no \"Login nico\" do governo federal, conta <a href='https://sso.acesso.gov.br/login?client_id=contas.acesso.gov.br&authorization_id=17e59336eff'>gov.br</a>.</p><p>Caso no possua uma conta gov.br, ser direcionado para a pgina do <a href='https://sso.acesso.gov.br/login?client_id=contas.acesso.gov.br&authorization_id=17e59336eff'>gov.br</a>, onde dever efetuar seu cadastro preenchendo todas as informaes solicitadas.</p><p>Aps concludo o cadastro, voc ser direcionado automaticamente para o sistema de inscrio do FIES,  s preencher as informaes solicitadas pelo sistema.</p>"},{title:"Como recuperar sua senha da conta gov.br",text:"Acesse <a href='https://acesso.gov.br/?_ga=2.227069012.81628025.1642173963-2008478269.1642173963'>https://acesso.gov.br</a> digite o nmero CPF no campo indicado da tela inicial e clique no boto <strong>Avanar</strong>, seguindo os procedimentos solicitados."},{title:"Tire suas dvidas sobre a renda familiar mensal bruta per capita",text:"O clculo da renda familiar mensal bruta per capita,  feita com base na soma da renda bruta de todos os membros do grupo familiar, dividida pelo nmero total de pessoas pertencentes ao referido grupo familiar."}],buttons:[{text:"Ver legislao do programa",uri:"http://portalfies.mec.gov.br/?pagina=legislacao",isForever:!0},{text:"Complementao da inscrio postergada",uri:"https://fiesselecaoaluno.mec.gov.br",startDate:"2023-02-07T00:00:01",endDate:"2023-02-09T23:59:59"},{text:"Consultar ofertas de vagas",uri:"https://fiesselecaoaluno.mec.gov.br/consulta",startDate:"2023-03-01T00:00:01",endDate:"2023-05-18T23:59:59"},{text:"Ver inscrio",uri:"https://fiesselecaoaluno.mec.gov.br",startDate:"2023-03-07T00:00:01",endDate:"2023-03-10T23:59:59"}]};
