module.exports={title:"Entenda o que  o Projeto Acesso nico",subtitle:"Projeto Portal nico de Acesso ao Ensino Superior",text:"<p>O MEC est redesenhando solues de tecnologia para os seus sistemas eletrnicos, por meio dos quais so ofertadas oportunidades de acesso ao ensino superior, como o Sistema de Seleo Unificada (<a href='/sisu'>Sisu</a>), Programa Universidade para Todos (<a href='/prouni'>Prouni</a>) e Fundo de Financiamento Estudantil (<a href='/fies'>Fies</a>). Trata-se do Projeto Acesso nico, iniciado com o desenvolvimento do Portal nico de Acesso ao Ensino Superior (Acesso nico), que tem a mesma marca do projeto, sendo uma parte relevante dele, mas no o todo. Ambos, projeto e novo portal, continuaro em desenvolvimento, ganhando ampliaes e aprimoramentos, at o final do ano.</p><p>O Projeto Acesso nico est alicerado em princpios como: segurana digital, modernidade, transparncia, participao do usurio, integrao, inteligncia, monitoramento e economicidade.</p><p>Para quem vai participar de mais de um processo seletivo s precisar inserir as informaes cadastrais para inscrio uma nica vez. A partir do primeiro registro de dados gerais de cadastro, o sistema do Acesso nico armazenar esses dados para que o candidato no precise repeti-los caso tente se inscrever nos demais processos seletivos vigentes. Precisar apenas complementar as informaes que forem especficas de cada seleo, observar se atende aos critrios para a participao e confirmar a sua inscrio, quando for o caso. Ou seja, o estudante no mais perder tempo com repeties de digitao de dados inseridos antes, em algum dos trs sistemas de inscrio.</p>",video:{},steps:[{icon:"fas fa-home",text:"Portal sobre os Programas de Acesso ao Ensino Superior",startDate:"",endDate:"",status:"active"},{icon:"fas fa-home",text:"Inscrio <br /> Unificada",startDate:"",endDate:"",status:"waiting"},{icon:"fas fa-home",text:"Integrao dos Processos Seletivos",startDate:"",endDate:"",status:"waiting"},{icon:"fas fa-home",text:"Chatbot e outros suportes",startDate:"",endDate:"",status:"waiting"},{icon:"fas fa-home",text:"Otimizao dos processos",startDate:"",endDate:"",status:"waiting"},{icon:"fas fa-home",text:"Concluso <br /> do Acesso nico",startDate:"",endDate:"",status:"waiting"}]};
